protected void processSetForegroundColorExt1(int r, int g, int b) throws IOException {
    int round = Colors.roundRgbColor(r, g, b, 16);
    processSetForegroundColor1(round >= 8 ? round - 8 : round, round >= 8);
}

// @Override
protected void processSetForegroundColorExt0(int paletteIndex) throws IOException {
    int round = Colors.roundColor0(paletteIndex, 16);
    processSetForegroundColor1(round >= 8 ? round - 8 : round, round >= 8);
}

public WindowsAnsiProcessor WindowsAnsiProcessor1(OutputStream ps) throws IOException {
    return WindowsAnsiProcessor0(ps, true);
}

public WindowsAnsiProcessor WindowsAnsiProcessor0(OutputStream ps, boolean stdout) throws IOException {
    return new WindowsAnsiProcessor(ps, GetStdHandle(stdout ? STD_OUTPUT_HANDLE : STD_ERROR_HANDLE));
}

public WindowsAnsiProcessor(OutputStream ps, long console) throws IOException {
    super(ps);
    this.console = console;
    getConsoleInfo();
    originalColors = info.attributes;
}

private void applyCursorPosition() throws IOException {
    if (SetConsoleCursorPosition(console, info.cursorPosition.copy()) == 0) {
        throw new IOException(Kernel32.getLastErrorMessage());
    }
}

private short invertAttributeColors(short attributes) {
    // Swap the the Foreground and Background bits.
    int fg = 0x000F & attributes;
    fg <<= 4;
    int bg = 0X00F0 & attributes;
    bg >>= 4;
    attributes = (short) ((attributes & 0xFF00) | fg | bg);
    return attributes;
}

private void applyAttribute() throws IOException {
    os.flush();
    short attributes = info.attributes;
    if (negative) {
        attributes = invertAttributeColors(attributes);
    }
    if (SetConsoleTextAttribute(console, attributes) == 0) {
        throw new IOException(Kernel32.getLastErrorMessage());
    }
}

private void getConsoleInfo() throws IOException {
    os.flush();
    if (GetConsoleScreenBufferInfo(console, info) == 0) {
        throw new IOException("Could not get the screen info: " + Kernel32.getLastErrorMessage());
    }
    if (negative) {
        info.attributes = invertAttributeColors(info.attributes);
    }
}

private static final short[] ANSI_BACKGROUND_COLOR_MAP = {
    BACKGROUND_BLACK,
    BACKGROUND_RED,
    BACKGROUND_GREEN,
    BACKGROUND_YELLOW,
    BACKGROUND_BLUE,
    BACKGROUND_MAGENTA,
    BACKGROUND_CYAN,
    BACKGROUND_WHITE,
};

private static final short[] ANSI_FOREGROUND_COLOR_MAP = {
    FOREGROUND_BLACK,
    FOREGROUND_RED,
    FOREGROUND_GREEN,
    FOREGROUND_YELLOW,
    FOREGROUND_BLUE,
    FOREGROUND_MAGENTA,
    FOREGROUND_CYAN,
    FOREGROUND_WHITE,
};
